import React from "react";
import Button from "react-bootstrap/Button";
import { MDBCol } from "mdbreact";

export default function Buttons(props) {
    const { dataCard } = props;

  return (
   <div>
    { dataCard.map((elem)=>{
     if(dataCard.categoryId)
     
      dataCard.filter((i)=>{
        return elem.category == i.category
      })
     return <div> <MDBCol md="3">
        <h2> {elem.category}</h2>
      </MDBCol>
      <MDBCol md="3">
        {" "}
        <Button
          className="CategoriesButton"
          variant="outline-secondary"
          id="button-addon2"
        >
          View More
        </Button>
      </MDBCol></div>
     })} </div>
  );
}
